import { ChakraProvider, ColorModeProvider} from '@chakra-ui/react';
import React from 'react';
import theme from '../theme';

function MyApp({Component, pageProps}: any) {
    return (
        <ChakraProvider theme={theme}>
            <ColorModeProvider>
                <Component {...pageProps} />
            </ColorModeProvider>
		</ChakraProvider>
	);
}

export default MyApp;
